import React from 'react';

export default function Sms({pismo}) {
    return (
        <>
            {
            pismo.trim() ?
                <>
                    <div className={'user'}>{pismo}</div>
                    <div className={'bot'}>Не понимаю о чем ты говоришь</div>
                </>
                : null
            }
        </>


    )
}
